CREATE TABLE CharacterAnimationCommands (
    id INT AUTO_INCREMENT,
    charId CHAR(2),
    subActionId INTEGER,
    commandIndex INTEGER,
    commandType INTEGER,
    commandData TINYBLOB,
    frame INTEGER,
    PRIMARY KEY (id),
    UNIQUE (charId, subActionId, commandIndex),
    FOREIGN KEY (charId, subActionId) REFERENCES Animations(charId, subActionId),
    FOREIGN KEY (commandType) REFERENCES AnimationCommandTypes(id)
);










